class StickHeader{stick(n,t,i,r){$(n).scroll(function(){const o=$(this).scrollTop(),f=$(t),u=f.find(" thead tr"),e=[];f.css({borderCollapse:"separate",borderSpacing:0});u.each((n,t)=>e.push($(t).height()));for(var n=0;n<u.length;n++){const t=$(u[n]),f=t.find(" th"),s=e.reduce((t,i,r)=>(r<n&&(t+=i),t),0);t.css({zIndex:999});o>i?f.css({position:"sticky",top:r+s+"px",zIndex:999}):f.css({position:"static"})}})}}var stickHeader=new StickHeader;